      var currentTemporalIdx = Radio.request('currentTemporalIdx');

      var x = this.chartOptions.x,
          y = this.chartOptions.y;

      var loadLine = this.chartOptions.loadLine = d3.svg.line()
          .x(function (d) {
            return x(d[0]);
          })
          .y(function (d) {
            return y(d[1]);
          });

      var loadSelection = parent.selectAll('.load')
