      // this.chartOptions.loadLineElement = this._createLoadLine(this.chartOptions.g, this.chartOptions.loadData, 'url(#clip)');

      // Time elements
      this.chartOptions.timeIndicator = this._createTimeIndicator(this.chartOptions.g, 'url(#clip)');
