define('scripts/views/ZonalGenerationChart',[
    'd3',
    'underscore',
    'radio',
    'appConfig',
    'scripts/views/GenerationChart'
], function (d3, _, Radio, CONFIG, GenerationChart) {
    return GenerationChart.extend({

        serializeData: function () {
            return {
                divId: this.divId
            }
        },

        initialize: function () {
            GenerationChart.prototype.initialize.apply(this, arguments);

            this.chartOptions.columnPadding = 0.1;
        },

        onShow: function () {

            this.createBaseSVG();
            this.createScales();
            this.setYScaleDomain();
            this.renderChart();
        },

        renderChart: function () {
            this.getData();
            this.addChartElements();
            this.addAxes();
        },

        _setListeners: function () {
            Radio.listen(this, 'change:currentTemporalIdx', this.renderChart.bind(this));
            Radio.listen(this, 'change:excludedFuelTypes', this._handleExcludedFuelTypesChange.bind(this));
        },

        createBaseSVG: function () {
            this.chartOptions.svg = d3.select(this.el).select('#' + this.divId).append('svg');
            this.chartOptions.g = this.chartOptions.svg.append('g')
                .attr('transform', 'translate(' + this.chartOptions.margin.left + ',' + this.chartOptions.margin.top + ')');

            this.chartOptions.height = this.$el.find('#' + this.divId).find('svg').outerHeight() - this.chartOptions.margin.top - this.chartOptions.margin.bottom
            this.chartOptions.width = this.$el.find('#' + this.divId).find('svg').outerWidth() - this.chartOptions.margin.left - this.chartOptions.margin.right

            this.chartOptions.background = this.chartOptions.g.append('rect')
                .attr('x', 0)
                .attr('y', 0)
                .attr('width', this.chartOptions.width)
                .attr('height', this.chartOptions.height)
                .style('fill', 'rgba(235,235,235,0.35')
                .attr('clip-path', 'url(#clip)');

            this.chartOptions.clipPath = this.chartOptions.svg.append("defs").append("svg:clipPath")
                .attr("id", "clip")
                .append("rect")
                .attr('width', this.chartOptions.width)
                .attr('height', this.chartOptions.height)
                .attr('x', 0)
                .attr('y', 0);
        },

        createScales: function () {
            this.chartOptions.y = d3.scale.linear()
                .range([this.chartOptions.height, 0]);
            this.chartOptions.x = d3.scale.ordinal()
                .rangeRoundBands([0, this.chartOptions.width], this.chartOptions.columnPadding)
                .domain(_.chain(Radio.request('data:zonalGeneration'))
                    .pluck('gid')
                    .uniq()
                    .value()
                    .sort()
                );
            
        },

        setYScaleDomain: function () {
            var rawData = Radio.request('data:zonalGeneration');

            var max = this.getDataMax(rawData);
            max = Math.max(max, this.getDataMax(Radio.request('data:loadZonal')));

            this.chartOptions.y.domain([0, max]);
        },

        getData: function () {
            var generationString = this.divId.indexOf('2') === -1 ? 'zonalGeneration' : 'zonalGeneration2',
                loadString = this.divId.indexOf('2') === -1 ? 'loadZonal' : 'loadZonal2';

            this.chartOptions.rawData = this.getRawData(generationString);

            var fuelExclusions = Radio.request("excludedFuelTypes")
            this.chartOptions.rawData = _.map(this.chartOptions.rawData, function (o) {
                return _.extend({}, o, {
                    values: _.contains(fuelExclusions, o.fuel_id) ? _.map(o.values, function () { return 0; }) : o.values
                })
            }, this);

            this.chartOptions.rawLoadData = this.getRawLoadData(loadString);

            this.chartOptions.data = this.parseRawData(this.chartOptions.rawData);

            this.chartOptions.loadData = this.parseRawLoadData(this.chartOptions.rawLoadData);
        },

        getDataMax: function (data) {

            var regions = _.chain(data)
                .pluck('gid')
                .uniq()
                .value()
                .sort();

            var max = d3.max(regions, function (region) {
                var maxByTime = _.chain(data)
                    .filter(function (o) {return o.gid == region; })
                    .reduce(function (totals, o) {
                        var values;
                        if (!totals) {
                            values = o.values;
                        } else {
                            values = _.map(totals, function (val, i) {
                                return val + o.values[i];
                            });
                        }

                        return values;
                    }, null)
                    .value();

                return d3.max(maxByTime);
            });

            return max;
        },
        
        getRawData: function (generationString) {
            return _.filter(Radio.request('data:' + generationString), function (o) {
                return o.fuel_id != 'load';
            });
        },

        getRawLoadData: function (loadString) {
            return Radio.request('data:' + loadString);
        },
        
        parseRawData: function (rawData) {
            var _this = this;
            var currentTemporalIdx = Radio.request('currentTemporalIdx');

            var fuelTypes = _.chain(rawData)
                .pluck('fuel_id')
                .uniq()
                .sortBy(function (s) {
                    return _this.chartOptions.stackOrder.indexOf(s);
                })
                .value();
            
            var regions = _.chain(rawData)
                .pluck('gid')
                .uniq()
                .value()
                .sort();
            
            var stack = d3.layout.stack()
                .values(function (o) {
                    return o.values;
                });

            return stack(_.map(fuelTypes, function (fuelType) {
                var values = _.map(regions, function (region) {
                    var o = _.findWhere(rawData, {gid: region, fuel_id: fuelType});

                    return {
                        x: region,
                        y: !!o ? o.values[currentTemporalIdx] : 0
                    }
                });

                return {
                    fuel_id: fuelType,
                    values: values
                }
            }));
        },
        
        parseRawLoadData: function (rawLoadData) {
            var currentTemporalIdx = Radio.request('currentTemporalIdx');

            var stack = d3.layout.stack()
                .values(function (o) {
                    return o.values;
                });
            var regions = _.chain(rawLoadData)
                .pluck('gid')
                .uniq()
                .value()
                .sort();

            var values = _.map(regions, function (region) {
                var o = _.findWhere(rawLoadData, {gid: region});
                var value = !!o ? o.values[currentTemporalIdx] : 0;

                return {
                    x: region,
                    y: value
                }
            });

            return stack([{
                fuel_id: 'load',
                values: values
            }]);
        },
        
        addChartElements: function () {
            this.chartOptions.stackedRects = this._createRects(this.chartOptions.g, this.chartOptions.data);

            this.chartOptions.loadLines = this._createLoadLines(this.chartOptions.g, this.chartOptions.loadData);

            // this.chartOptions.timeDisplay = this._createTimeDisplay(this.chartOptions.g);
        },
        
        addAxes: function () {
            // Add y axis
            var y = this.chartOptions.y
            var yAxisFormat = d3.format(',s');
            this.chartOptions.g.selectAll('.y-axis').remove();
            var yAxis = d3.svg.axis()
                .scale(y)
                .orient('left')
                .ticks(5)
                .tickFormat(yAxisFormat);
            this.chartOptions.g.append('g')
                .classed('y-axis', true)
                .call(yAxis);

            this.chartOptions.yAxis =  yAxis;

            // Add x axis
            var x = this.chartOptions.x;

            this.chartOptions.g.selectAll('.x-axis').remove();
            var xAxis = d3.svg.axis()
                .scale(x)
                .orient('bottom');
            this.chartOptions.g.append('g')
                .attr('transform', 'translate(0,' + this.chartOptions.height + ')')
                .classed('x-axis', true)
                .call(xAxis);
            this.chartOptions.xAxis = xAxis
        },
        
        _createRects: function (parent, data) {
            var _this = this;
            var transitionDuration = CONFIG.timeDelay;
            
            var rects = parent.selectAll('.fuel-types')
                .data(data, function (d) {
                    return d.fuel_id;
                });
            rects.enter()
                .append('g')
                .attr('clip-path', this.chartOptions.clipPath)
                .classed('fuel-types', true);
            
            rects.selectAll('rect')
                .data(function (d) {return _.map(d.values, function (o) {
                    return _.extend({}, o, {color: 'rgb(' + _this.chartOptions.colorPalette[d.fuel_id].join(',') + ')'})
                }); })
                .enter()
                .append('rect')
                .style('fill', function (d) {
                    return d.color;
                })
                .attr("width", _this.chartOptions.x.rangeBand() - 1);

            rects.selectAll('rect')
                .transition()
                .duration(transitionDuration)
                .ease('linear')
                .attr("x", function(d) { return _this.chartOptions.x(d.x); })
                .attr("y", function(d) {
                    var y = _this.chartOptions.y(d.y + d.y0);
                    return y;

                })
                .attr("height", function(d) { return _this.chartOptions.y(d.y0) - _this.chartOptions.y(d.y + d.y0); });
        },

        _createLoadLines: function (parent, loadData) {
            var _this = this;
            var transitionDuration = CONFIG.timeDelay;

            if (_.contains(this.fuelExclusions, 'load')) { loadData = []; }
            
            var loadLines = parent.selectAll('.load-lines')
                .data(loadData, function (d) {
                    return d.fuel_id;
                });

            loadLines.enter()
                .append('g')
                .attr('clip-path', this.chartOptions.clipPath)
                .classed('load-lines', true);

            loadLines.selectAll('line')
                .data(function (d) {return d.values; })
                .enter()
                .append('line')
                .attr('stroke','rgb(' + _this.chartOptions.colorPalette['load'].join(',') + ')')
                .attr('stroke-width', 2)
                .style('stroke-dasharray', "4, 4");

            loadLines.selectAll('line')
                .transition()
                .duration(transitionDuration)
                .ease('linear')
                .attr('x1', function (d) { return _this.chartOptions.x(d.x)})
                .attr('x2', function (d) { return _this.chartOptions.x(d.x) + _this.chartOptions.x.rangeBand() - 1})
                .attr('y1', function (d) { return _this.chartOptions.y(d.y); })
                .attr('y2', function (d) { return _this.chartOptions.y(d.y); });

            loadLines.exit()
                .remove();
        },

        _handleExcludedFuelTypesChange: function () {
            this.renderChart();
        }
    });
});
