define('scripts/views/DisplayPickerView',[
    'marionette',
    'templates',
    'radio'
], function (Mn, Templates, Radio) {


    return Mn.ItemView.extend({
        template: Templates['displayPicker'],

        ui: {
            displayOption: '.display-option'
        },

        events: {
            'click @ui.displayOption': 'updateCurrentDisplayOption',
        },

        serializeData: function () {
            return {
                currentDisplayOption: Radio.request('currentDisplayOption'),
                displayOptions: Radio.request('displayOptions')
            };
        },

        initialize: function () {
            this._setListeners();
        },

        onRender: function () {
            this._adjustSizes();
        },

        _setListeners: function () {
            Radio.listen(this, 'data:ready', this.render.bind(this));
            Radio.listen(this, 'change:currentDisplayOption', this.render.bind(this));
        },

        updateCurrentDisplayOption: function (e) {
            var displayOptionId = $(e.target).attr('id');
            Radio.execute('setCurrentDisplayOption', displayOptionId);
        },

        _adjustSizes: function () {
            var windowHeight = $(window).height();

            if (windowHeight < 900) {
                var $container = $(this.el);
                $container.find('h2').css('font-size', '18px');
                $container.find('p').css('font-size', '10px');
                $container.find('input, label').css('font-size', '14px');
            }
        }


    });
});
