define('scripts/views/AppLayoutView',[
    'jquery',
    'd3',
    'marionette',
    'templates',
    'radio',
    'appConfig',
    'scripts/app',
    'scripts/views/CumulativeTableView',
    'scripts/views/MapView',
    'scripts/views/SharedLegendView',
    'scripts/views/MapLegendView',
    'scripts/views/TimeChartView',
    'scripts/views/ScenarioPickerView',
    'scripts/views/MetricPickerView',
    'scripts/views/TimePickerView',
    'scripts/views/MapPopupView',
    'scripts/views/DisplayPickerView'
], function (
    $,
    d3,
    Mn, 
    Templates,
    Radio,
    CONFIG,
    App,
    CumulativeTableView, 
    MapView, 
    SharedLegendView,
    MapLegendView,
    TimeChartView,
    ScenarioPickerView,
    MetricPickerView,
    TimePickerView,
    MapPopupView,
    DisplayPickerView
) {
    return Mn.LayoutView.extend({

        el: '#gtg-india-app',
        template: Templates['app'],

        ui: {
            mapPopup: '#map-popup'
        },

        regions: {
            mainMap: '#map',
            cumulativeTable: '#gtg-cumulative-table',
            sharedLegend: '#shared-legend',
            mapLegend: '#map-legend',
            scenarioPicker: '#scenario-picker',
            metricPicker: '#metric-picker',
            displayPicker: '#display-picker',
            timeChart: '#chart',
            timePicker: '#time-picker',
            mapPopup: '#map-popup'
        },

        serializeData: function () {
          return {
              mainTitle: 'South Africa Grid Integration Study (Test)',
              mainSubTitle: '',
              mainDescription: 'An interactive scenario viewer for modeled integration of renewables into the electric grid for the Republic of India.'
          }
        },

        initialize: function () {
            this._setListeners();
        },

        _setListeners: function () {
            Radio.setHandler('commands', 'showMapPopup', this.showMapPopup.bind(this));
            Radio.setHandler('commands', 'moveMapPopup', this.moveMapPopup.bind(this));
            Radio.setHandler('commands', 'hideMapPopup', this.hideMapPopup.bind(this));

            Radio.listen(this, 'change:currentDisplayOption', this.onNewDisplayOption.bind(this));
        },

        onRender: function () {
            this._adjustSizes();

            // this.showChildView('cumulativeTable', new CumulativeTableView());
            this.showChildView('mainMap', new MapView());
            this.showChildView('timeChart', new TimeChartView());
            this.showChildView('scenarioPicker', new ScenarioPickerView());
            this.showChildView('metricPicker', new MetricPickerView());
            // this.showChildView('displayPicker', new DisplayPickerView());
            this.showChildView('timePicker', new TimePickerView());
            this.showChildView('mapLegend', new MapLegendView());

            var currentDisplayFormat = Radio.request('currentDisplayOption');
            if (currentDisplayFormat.id === 'chart') {
                this.showChildView('sharedLegend', new SharedLegendView());
            }
        },

        onNewDisplayOption: function () {
            var currentDisplayFormat = Radio.request('currentDisplayOption');
            if (currentDisplayFormat.id === 'chart') {
                this.showChildView('sharedLegend', new SharedLegendView());
            } else {
                this.sharedLegend.empty();
            }
        },

        moveMapPopup: function (position) {

            var top = (position[1] - this.ui.mapPopup.height()) < 10 ? 10 :
                position[1] > (this.$el.height() - 10) ? this.$el.height() - 10 : position[1] - this.ui.mapPopup.height();
            var left = (position[0] + this.ui.mapPopup.outerWidth() + 10 < 0) ? 10 :
                (position[0] + this.ui.mapPopup.outerWidth() + 10) > this.$el.width() ? this.$el.width() - this.ui.mapPopup.width() - 10 : position[0] + 10;

            this.ui.mapPopup.offset({
                left: left,
                top: top
            });
        },

        showMapPopup: function (position, gid) {
            this.moveMapPopup(position);

            this.showChildView('mapPopup', new MapPopupView({
                gid: gid
            })) ;

            this.ui.mapPopup.removeClass('invisible');
        },

        hideMapPopup: function () {
            this.ui.mapPopup.addClass('invisible')
        },

        _adjustSizes: function () {
            var windowHeight = $(window).height();

            if (windowHeight < 700) {
                var mainTitle = this.$el.find('#title-pane h2'),
                    mainSubTitle = this.$el.find('#title-pane h3'),
                    mainDescription = this.$el.find('#title-pane p');

                mainTitle.css('font-size', '1.2em');
                mainSubTitle.css('font-size', '2.4em');
                mainDescription.css('font-size', '0.8em');
            }

            if (windowHeight < 940) {
                var sharedLegend = this.$el.find('#shared-legend');

                sharedLegend.css('bottom', '8px');
                sharedLegend.css('left', '4px');
            }
        }

    });
});
require([
    "jquery",
    "bootstrap",
    "underscore",
    "backbone",
    "scripts/patches",
    "appConfig",
    "scripts/app",
    "scripts/models/AppModel",
    "scripts/models/ScenarioDataModel",
    "scripts/collections/BaseLayersCollection",
    "scripts/models/DataLayerModel",
    "scripts/collections/AnnualDataCollection",
    "scripts/models/ZonalGenerationDataModel",
    "scripts/models/NationalDataModel",
    "scripts/models/LoadDataModel",
    "scripts/views/AppLayoutView",
    "radio"
    ],

    function (
        $,
        bootstrap,
        _,
        Backbone,
        Extend,
        CONFIG,
        App,
        AppModel,
        ScenarioDataModel,
        BaseLayersCollection,
        DataLayerModel,
        AnnualDataCollection,
        ZonalGenerationDataModel,
        NationalDataModel,
        LoadDataModel,
        AppLayoutView,
        Radio) {

        // Initiate spinner
        App.startSpinner();

        // Apply custom patches
        Extend.Backbone(Backbone);

        // Set up models before app initialization
        App.on('before:start', function () {

            // Create the main app model that will store application state
            var appModel = new AppModel();

            // Listen for the fetch event and wait until all models are ready before initializing the app
            this.listenTo(App.vent, 'change:data', function () {
                var allData = _.every(App.Models, function (model) {
                    return model.get('ready');
                });

                // When all data has been fetched, initialize the app views
                if (allData) {
                    App.stopSpinner();
                    // var appLayoutView = new AppLayoutView();
                    // appLayoutView.render();
                    App.stopListening();
                }

            });

            App.resetModels(true);

        });


        // Method to set the models used in the current version of the app
        App.resetModels = function resetModels(refresh) {
            App.startSpinner();

            var currentMetric = Radio.request('currentMetric'),
                currentGeographyType = Radio.request('currentGeographyType'),
                currentScenario = Radio.request('currentScenario'),
                currentScenario2 = Radio.request('currentScenario2'),
                currentTemporalType = Radio.request('currentTemporalType');

            // Remove all current models
            for (var k in App.Models) {
                delete App.Models[k];
            }
            
            /***********************
                Add all data models
             **********************/

            // Scenario JSON data

            App.Models.ScenarioData = new ScenarioDataModel({
                id: [currentScenario, currentGeographyType.id, currentTemporalType.id, currentMetric.id].join('_') + '.json',
                datasetId: 'scenario'
            });

            // App.Models.ScenarioData2 = new ScenarioDataModel({
            //     id: [currentScenario2, currentGeographyType.id, currentTemporalType.id, currentMetric.id].join('_') + '.json',
            //     datasetId: 'scenario2'
            // });

            // Spatial base layers
            var baselayers = currentGeographyType.basemaps ? _.map(currentGeographyType.basemaps, function (s) {
                return {
                    id: s
                };
            }) : [];
            App.Models.BaseLayers = new BaseLayersCollection(baselayers);

            // Spatial data layer
            var prefix = Radio.request('currentGeographyType').data_layer;
            App.Models.DataLayer = new DataLayerModel({
                id: [prefix, currentMetric.id].join('_') + '.topo.json'
            });

            // // Annual data
            // // TODO: change this when we have state data available
            // var annualDatasets = _.map(['emissions', 'fuel_use', 'operating_costs', 'generation'], function (s) {
            //     return {
            //         id: [currentScenario, 'total', 'total', s].join('_') + '.json',
            //         datasetId: s
            //     }
            // });
            // App.Models.AnnualData = new AnnualDataCollection(annualDatasets);
            //
            // // Load data
            //
            // App.Models.LoadData = new LoadDataModel({
            //     id: [currentScenario, currentGeographyType.id, 'interval', 'load'].join('_') + '.json',
            //     datasetId: 'load'
            // });
            // App.Models.LoadData2 = new LoadDataModel({
            //     id: [currentScenario2, currentGeographyType.id, 'interval', 'load'].join('_') + '.json',
            //     datasetId: 'load2'
            // });
            // App.Models.NationalLoadData = new LoadDataModel({
            //     id: [currentScenario, 'total', 'interval', 'load'].join('_') + '.json',
            //     datasetId: 'loadNational'
            // });
            // App.Models.NationalLoadData2 = new LoadDataModel({
            //     id: [currentScenario2, 'total', 'interval', 'load'].join('_') + '.json',
            //     datasetId: 'loadNational2'
            // });
            // App.Models.ZonalLoadData = new LoadDataModel({
            //     id: [currentScenario, 'zones', 'interval', 'load'].join('_') + '.json',
            //     datasetId: 'loadZonal'
            // });
            // // For the interstate flow version we also need to get generation data for the chart
            //
            switch (currentMetric.id) {
                // case 'interstate_flow':
                //     App.Models.ZonalGeneration = new ZonalGenerationDataModel({
                //         id: [currentScenario, 'zones', currentTemporalType.id, 'generation'].join('_') + '.json'
                //     });
                //     break;
                // case 'generation':
                //     App.Models.NationalData = new NationalDataModel({
                //         id: [currentScenario, 'total', currentTemporalType.id, currentMetric.id].join('_') + '.json',
                //         datasetId: 'national'
                //     });
                //     App.Models.NationalData2 = new NationalDataModel({
                //         id: [currentScenario2, 'total', currentTemporalType.id, currentMetric.id].join('_') + '.json',
                //         datasetId: 'national2'
                //     });
                //     break;
              default:
                App.Models.NationalData = new NationalDataModel({
                  id: [currentScenario, 'total', currentTemporalType.id, 'generation'].join('_') + '.json',
                  datasetId: 'national'
                });
                App.Models.NationalData2 = new NationalDataModel({
                  id: [currentScenario2, 'total', currentTemporalType.id, 'generation'].join('_') + '.json',
                  datasetId: 'national2'
                });
            }

            // Listen for the fetch event and wait until all models are ready before initializing the app
            this.listenTo(App.vent, 'change:data', function () {
                var allData = _.every(App.Models, function (model) {
                    var ready = false;

                    if (model instanceof Backbone.Model) {
                        ready = model.get('ready');
                    } else if (model instanceof Backbone.Collection) {
                        ready = model.every(function (m) {
                            return m.get('ready');
                        });
                    }
                    
                    return ready;
                });

                // When all data has been fetched, initialize the app views
                if (allData) {
                    
                    console.log('-- Fetched data for ' + Object.keys(App.Models).join(', ')  );

                    Radio.trigger('data:ready');
                    if (refresh) {
                        var appLayoutView = new AppLayoutView();
                        appLayoutView.render();
                    }
                    App.stopSpinner();
                    App.stopListening();
                }
            });

            // Start fetching
            for (k in App.Models) {
                if (App.Models[k] instanceof Backbone.Model) {
                    App.Models[k].fetch();
                } else if (App.Models[k] instanceof Backbone.Collection) {
                    App.Models[k].each(function (m) {
                        m.fetch();
                    });
                }

            }

        };

        Radio.setHandler('commands', 'resetModels', App.resetModels.bind(App));
        // Radio.setHandler('commands', 'startSpinner', App.startSpinner.bind(App));

        App.on('start', function () {

            // Trigger the initial route and enable HTML5 History API support
            Backbone.history.start({pushState: true});

        });

        // Define your master router on the application namespace and trigger all
        // navigation from this instance.
        App.start();

        window.App = App;

        // All navigation that is relative should be passed through the navigate
        // method, to be processed by the router. If the link has a `data-bypass`
        // attribute, bypass the delegation completely.
        $(document).on("click", "a:not([data-bypass])", function (e) {
            // Get the absolute anchor href.
            var href = {
                    prop: $(this).prop("href"),
                    attr: $(this).attr("href")
                },
                root = location.protocol + "//" + location.host + App.root;

            // Ensure the root is part of the anchor href, meaning it's relative.
            if (href.prop && href.prop.slice(0, root.length) === root) {
                e.preventDefault();
                Backbone.history.navigate(href.attr, true);
            }
        });

        $(document).on("click", "a[data-bypass]", function (e) {
            e.preventDefault();
        });

    });

